INSERT INTO `userReviews` VALUES (1,2,1,4,'Great service, thank you!','2025-01-20 19:37:19'),(2,3,1,5,'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque imperdiet nulla in lacus pellentesque, at suscipit erat dignissim. Integer auctor sapien non est laoreet, et vehicula orci euismod.','2025-01-20 19:37:19'),(3,4,1,4,'The product quality is quite good. The transaction was smooth, and the seller was responsive. There were some minor issues, but overall, it was a positive experience. Would recommend to others!','2025-01-20 19:37:19'),(4,5,1,5,'Excellent service and product quality! The seller was very accommodating and the transaction was seamless. I would definitely recommend this seller to others.','2025-01-20 19:37:19'),(5,6,1,5,'Amazing service! The pig arrived in perfect health and was exactly as described. I highly recommend this seller to everyone.','2025-01-20 19:37:19'),(6,7,1,4,'The pig was in great condition and the transaction was smooth. However, the delivery was delayed by a day, so I’m giving it 4 stars.','2025-01-20 19:37:19'),(7,8,1,3,'The pig was okay, but it wasn’t as healthy as I expected. The seller could improve the quality control process.','2025-01-20 19:37:19'),(8,9,1,1,'Well, the pig which I supposed to receive... was already dead. Thank you!','2025-01-20 19:37:19'),(9,10,1,5,'Excellent experience! The seller was very responsive, and the pig was in perfect condition upon arrival. I highly recommend this seller to others.','2025-01-20 19:37:19'),(10,11,1,4,'The product was as described, and the customer service was helpful. The delivery could have been quicker, but overall, I am satisfied with the purchase.','2025-01-20 19:37:19'),(11,12,1,4,'The overall experience was positive, but the product arrived slightly later than expected. The seller was responsive and addressed my concerns promptly.','2025-01-20 19:37:19');
